class SkHubComponent extends shapez.Component {

    static getId() {
        return "SkHub";
    }

    static getSchema() {
        return {

        };
    }

    constructor() {
        super();

    }
}


////////////////////////////////////////////////////////////////////////
class SkHubSystem extends shapez.GameSystemWithFilter {
    constructor(root) {
        super(root, [SkHubComponent]);
    }

    update() {
        //const contents = chunk.containedEntitiesByLayer.regular;
        //for (let i = 0; i < contents.length; ++i) {
        //    const entity = contents[i];

        for (let i = 0; i < this.allEntities.length; ++i) {
            const entity = this.allEntities[i];
            const pinsComp = entity.components.WiredPins;
            if (!pinsComp) {
                continue;
            }

            pinsComp.slots[0].value = this.root.shapeDefinitionMgr.getShapeItemFromDefinition(
                this.root.hubGoals.currentGoal.definition
            );
        }
    }
}

class Mod extends shapez.Mod {
    init() {

        this.modInterface.registerComponent(SkHubComponent);
        // Register the new building
        this.modInterface.registerNewBuilding({
            metaClass: MetaHubBuilding,
            buildingIconBase64: RESOURCES.mhub.icon,
        });

        // Add it to the regular toolbar
        this.modInterface.addNewBuildingToToolbar({
            toolbar: "regular",
            location: "secondary",
            metaClass: MetaHubBuilding,
        });

        this.modInterface.registerGameSystem({
            id: "SkHub",
            systemClass: SkHubSystem,
            before: "constantSignal",
        });
    }

}

